import React from "react";
import Marmut1 from "../assets/images/marmut1.jpg";

export default function Home() {
  return (
    <div className="flex mt-[100px] justify-between ">
      <div>
        <p className="">Hello Marmot Lovers,</p>
      </div>

      <div>
        <img
          src={Marmut1}
          style={{ width: 526, height: 305 }}
          className="rounded-t-[50px] rounded-b-[100px]"
        />
      </div>
    </div>
  );
}
